import Layout from '../components/layout'
import GoogleMapReact from 'google-map-react'
import {useRouter} from 'next/router'

const defaultProps = {
    center: {
        lat: 13.734114,
        lng: 100.528321,
    },
    zoom: 17,
}

const Marker = props => {
    return <img style={{width:"1rem", height:"5rem"}} src = "https://www.flaticon.com/svg/static/icons/svg/2991/2991231.svg" />
}

export default function Contact() {
    const {locale} = useRouter()
    return (
        <Layout>
            <div>
                <h1>Contact</h1>
                <div>
                    <div>
                        <h1>Homgroon Shop</h1>
                        <h1>214/17 Siam Paragon Bangkok</h1>
                    </div>
                    <h1>Contact: 081-4219084</h1>
                    {/* <div></div> */}
                    <div style={{height: "50vh", width: "100%"}}>
                        <GoogleMapReact
                            bootstrapURLKeys = {{
                                language: locale
                                //key:"AIzaSyDlkP9JL19YsHZYhW9PWAOv4Zuo3s3jZ38"
                            }}
                            defaultCenter = {defaultProps.center}
                            defaultZoom = {defaultProps.zoom}
                        >
                            <Marker lat={defaultProps.center.lat} lng={defaultProps.center.lng} />

                        </GoogleMapReact>
                    </div>
                </div>
            </div>

        </Layout>
    )
}
